import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css'

import Home from './components/home/home.jsx';
import Login from './components/login/login';
import Register from './components/register/register';
import Header from './components/header/header.js'
import SecurePage from './pages/securePage.js';
import { UserContextProvider } from './context/userContext';

/* TODO: Set authentication context for secured APIs that calls Login function if no token is accessable 
   TODO: Set check for Auth token */


function App() {
  const [isLoggedIn, setisLoggedIn] = useState(null);
  const logIn = () => {
    setisLoggedIn(true);
  };
  const logOut = () => {
    setisLoggedIn(false);
  };


  return (

  <UserContextProvider>
    <Router>
      <div>
        <Header />
        {isLoggedIn ? (
        <button onClick={logOut}>Logout</button>
      ) : (
        <button onClick={logIn}>Login</button>
      )}
      <Routes>
          <Route path="/" exact element={<Home/>} />
          <Route path="/login" exact element={<Login />} />
          <Route path="/register" exact element={<Register />} />
          <Route path="/secure" exact element={<SecurePage />} />
      </Routes>
      </div>
    </Router>
  </UserContextProvider>
  );

}

export default App;
